package model;import model.Action;import java.util.List;public class OutgoingMessage {    private final long chatId;    private String replyText;    private List<Action> availableActions;    private int messageId;    public OutgoingMessage(long chatId) {        this.chatId = chatId;    }    public OutgoingMessage(long chatId, int messageId) {        this.chatId = chatId;        this.messageId = messageId;    }    public int getMessageId() {        return messageId;    }    public long getChatId() {        return chatId;    }    public String getReplyText() {        return replyText;    }    public List<Action> getAvailableActions() {        return availableActions;    }    public void setReplyText(String replyText) {        this.replyText = replyText;    }    public void setAvailableActions(List<Action> availableActions) {        this.availableActions = availableActions;    }}